import React from 'react';
import { navigationsLinks } from './NavigationLinks';

const Navigation = () => {
	return (
		<nav>
			<ul>
				{navigationsLinks.map((link) => {
					return <li></li>;
				})}
			</ul>
		</nav>
	);
};

export default Navigation;
